import logo from './logo.svg';
import './App.css';
import Home from './pages/Home'
import { BrowserRouter as Router, Route, Link, Switch} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>

          <Route path='/' component={App} />
          <Route path='/home' component=<Home/> />
      </Router> 
    </div>
  );
}

export default App;
